css:
.header-view {
  position: fixed;
  width: 100%;
  z-index: 10;
  position: relative;
}
.header-view .heading-close {
  color: #181a1b;
}
.header-view .heading-title {
  padding-left: 6px;
}
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #d5880b;
}
.header-view .icon-check {
  color: #2db448;
}
.header-view .icon-hourglass {
  color: #303336;
}
.header-view .icon-stop {
  color: #f42a2a;
}
.script-view {
  overflow: scroll;
  max-height: 300px;
  height: auto;
  margin-bottom: 0px;
}
.script-view .panel-body pre {
  background: #d4d6d9;
  color: #303336;
}
.script-view .stderr {
  color: #f42a2a;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
